ko.components.register("view-more",{viewModel:function(n){var t=this;t.currentPage=ko.observable(0);t.currentPageSize=ko.observable(6);t.listNews=ko.observableArray([]);t.categoryId=ko.observable(n.categoryId);t.totalPage=ko.observable(n.totalPage);t.isLoadding=ko.observable(!1);t.viewMore=function(){t.currentPage(ko.utils.unwrapObservable(t.currentPage())+1);t.isLoadding(!0);$.post("view-more-news",{categoryId:t.categoryId(),page:t.currentPage(),pageSize:t.currentPageSize()},function(n){console.log(n);t.listNews.push.apply(t.listNews,n);t.isLoadding(!1)})};t.handleString=function(n,t){return t.substr(0,70)}},template:{element:"btn-viewmore"}});